import { useState, useEffect } from "react";

function Dashboard() {
  const [loading, setLoading] = useState(true);
  const [results_files, setResultsFiles] = useState("");
  const [metadata, setMetadata] = useState([]);

  useEffect(() => {
    fetch("http://20.191.211.229:5000/v1/datafiles?filetype=tdf&max_size=30", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res => {
        return res.json();
      })
      .then(files => {
        setLoading(false);
        setResultsFiles(results_files);

        // results_files.map(file => {
        //   setMetadata(file);
        // });
      });
  }, []);

  return (
    <div>
      {loading || !results_files ? (
        <h1>Loading...</h1>
      ) : (
        <div>
          {results_files.map(result => {
            return (
              <div id={result.file_id} className="results">
                <p>Filename: {result.filename}</p>
                <p>Filetype: {result.filetype}</p>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
}

export default Dashboard;
